import React, {Component} from 'react';
export default class PopUp extends Component {
    render(){
        const {isPopUp, isBreathingEx} = this.props;

        let _clickedClose, _clickedMore;
        if (isPopUp === false){_clicked = true;}else{_clicked = false;}
        if (isBreathingEx === false){_clicked = true;}else{_clicked = false;}
        return (
            <div>
                <div className='border bg-yellow padding-md'>
                <h1>Stress level update</h1>
                <input type="button" value="Close"
                    onClick={function(){
                    this.props.onClose(_clicked);
                }.bind(this)}></input>
                <input type="button" value="Learn more"
                    onClick={function(){
                    this.props.onCloseRec(_clicked);
                }.bind(this)}></input>
                </div>
            </div>
        )
    }
}
